const initialState = {
    name1: "James",
    name2: "Mike"
};

export const generateSetName1ActionWithName = name => ({
    type: "ADD_NAME_1",
    name
});

export const setName2 = name => ({
    type: "ADD_NAME_2",
    name
});

const reducer = (state = initialState, action={type:"UNKNOWN"}) => {
    switch (action.type) {
        case "ADD_NAME_1":
            return {
                ...state,
                name1: action.name
            };
        case "ADD_NAME_2":
            return {
                ...state,
                name2: action.name
            };
        default:
            return state;
    }
};

export default reducer;
